import './App.css';
import './Settings.css';
import './Profile.css';
import './Chat.css';
import './Login.css';
import user_img from './user.png'
import chats_img from './comment.png'
import setting_img from './settings.png'
import logout_img from './logout.png'
import { Chats } from './components/Chats';
import { ChatArea } from './components/ChatArea';
import { Settings } from './components/SettingsArea';
import { checkCookie } from './checkcookie';
import { useState } from 'react';
import { Profile } from './components/ProfileArea';
import { useEffect } from 'react';
import axios from 'axios';

function App(){
    const [state,set_state] = useState(1);
    const toggleTab = (index)=>{
        set_state(index)
    }

    const [form,set_form] = useState(1);
    const toggleForm = (index)=>{
        set_form(index);
    }
    const [user, setUser] = useState(null);
    useEffect(() => {
        axios.get('http://localhost:8000.api/v1/Current/', { withCredentials: true })
            .then(response => {
                setUser(response.data);
            })
            .catch(error => {
                console.error(error);
            });
    }, []);
{if(user)
{
    return(
    <>
        <div class="application">
            <div class="nav">
                <div className={state === 1 ? "nav_item_active":"nav_item"} onClick={() => toggleTab(1)}>
                    <img src={user_img} alt=""/>
                    <span>Profile</span>
                </div>
                <div className={state === 2 ? "nav_item_active":"nav_item"} onClick={() => toggleTab(2)}>
                    <img src={chats_img} alt=""/>
                    <span>Chats</span>
                </div>
                <div class={state === 3 ? "nav_item_active":"nav_item"} onClick={() => toggleTab(3)}>
                    <img src={setting_img} alt=""/>
                    <span>Settings</span>
                </div>
                <div class="nav_item">
                    <img src={logout_img} alt=""/>
                    <span>Log out</span>
                </div>
            </div>
            <div class="main_content">
                <div class="chat_wrapper">
                    <div class="main_area">
                        {state === 1 && <Profile/>}
                        {state === 2 && <ChatArea/>}
                        {state === 3 && <Settings/>}
                    </div>
                </div>
                <div class="another_menu">
                <div class="chat_list">
                        <input type="text" placeholder="search"/>
                        <div class="chats">
                            <Chats/>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    </>
    );
}else{
    return(
    <>
    <div className="container">
        <div className="block">
                <section className="block_item">
                    <h2>У вас есть аккаунт?</h2>
                    <button className="sign-in" onClick={()=>toggleForm(1)}>Login</button>
                </section>
                <section className="block_item">
                    <h2>У вас нету аккаунта?</h2>
                    <button className="sign-up" onClick={()=>toggleForm(2)}>Register</button>
                </section>
        </div>
        <div className={form === 1 ? 'form_box' : 'form_box_active'}>
            <form action='#' className='form form_signin'>
                <h3 className='form_title'>Вход</h3>
                <p>
                    <input type="text" className='form_input' placeholder='username'/>
                </p>
                <p>
                    <input type="password" className='form_input' placeholder='password'/>
                </p>
                <p>
                    <button>Вход</button>
                </p>
            </form>
            <form action='#' className='form form_signup'>
                <h3 className='form_title'>Регистрация</h3>
                <p>
                    <input type="text" className='form_input' placeholder='username'/>
                </p>
                <p>
                    <input type="password" className='form_input' placeholder='password'/>
                </p>
                <p>
                    <input type="email" className='form_input' placeholder='email'/>
                </p>
                <p>
                    <button>Зарегистрироваться</button>
                </p>
            </form>
        </div>
    </div>
   </>
    )
}}
}
export default App;
